import { useState, createContext, useContext } from "react"
import { getUsuariosRequests } from "../api/apiusuarios"
const UsuariosContext = createContext()

export const useUsuarios = () =>{
    const contextoUsuarios = useContext(UsuariosContext)
    return contextoUsuarios
}

export const postUsuarios = ({ children }) =>{
    const [usuarios, setUsuarios] = useState([])

    const getUsuarios = async () =>{
        const todoslosUsuarios = await getUsuariosRequests()
        console.log(todoslosUsuarios)
    }

    return <postUsuarios.Provider value={{
        usuarios,
        getUsuarios
    }}>
        {children}
    </postUsuarios.Provider>
}
